response.about:
Полное Имя: Максимова Марина Сергеевна;
Псевдоним: МакSим;
Дата Рождения: 10 июня 1983 года;
Знак Зодиака: Близнецы;
Место Рождения: Казань (Республика Татарстан, Россия);
Место Жительства: Москва (Россия);
Родители: Светлана Викторовна и Сергей Орефьевич;
Брат: Максим Сергеевич;
Муж: Алексей;
Дети: Дочь Александра;
Цвет Глаз: Зеленый;
Цвет Волос: Брюнетка;
Похожа: На маму;
Рост: 160 см;
Образование: Казанский государственный университет, факультет PR;
Голосовой диапозон: Три октавы;
Увлечения: Парашютный спорт, экстрим, спортивные самолеты, музыка;
Любит: Музыку и животных;
Не Любит: Предательство, подлость, вопросы о личной жизни;
Любимое Место Отдыха: Дома у мамы, в Казани;
Любимые Группы: Pink Floyd, Deep Purple, YES, Агата Кристи;
Любимые Поэты: Анна Ахматова, Марина Цветаева;
Любимые Актеры: Братья Чадовы;
Любимая Актриса: Рената Литвинова;
Любимая Музыка: По настроению;
Любимые Цвета: Синий, белый;
Любимый Цветок: Ромашка;
Вредные Привычки: Ужасная вредина;
Главный Недостаток: Излишняя честность;
Главное Достоинство: Стремление к внутреннему развитию;
Боится: Пауков;
Заветная Мечта: Выспаться, собрать "Олимпийский";
Основное Качество: Умение писать стихи;
Татуировка: Кошка с инициалами;
Шрамы: Один шрам на лбу;
Стиль Одежды: Удобный;
Звукозаписывающая Компания: Gala Records;
Первое Выступление: В музыкальной школе;
Талисман: Карта Джокера;
Парни: Предпочитает честных, чистолюбивых и мужественных парней;
Первая Песня: В 7 лет написала песню о войне;
Жизненная Цель: Хочет все уметь;
Идеальные Мужчины: Стинг, Джон Траволта, Алексей Чадов;
Любимый Аксессуар: Сумка в виде гитары

Награды:
1. НФПФ 2006 — Золотой диск за альбом «Трудный возраст».
2. Золотой Граммофон 2006 — статуэтка за песню «Нежность».
3. Песня года 2006 — диплом за песню «Нежность». 4. Love Radio Awards 2006 — певица года.
5. НФПФ 2006 — Платиновый диск за альбом «Трудный возраст».
6. Премия Муз-ТВ 2007 — прорыв года и лучший рингтон.
7. Russian Music Awards 2007 Mtv — лучший поп-проект, лучшая исполнительница.
8. Премия Рекорд 2007 — лучший дебют, лучший музыкальный DVD.
9. Звуковая дорожка 2008 — лучшая исполнительница года.
10. НФПФ 2008 — Бриллиантовый диск за альбом «Мой рай».
11. Премия Радиомания 2008 — бронзовый микрофон за лучшую певицу.
12. Премия Муз-ТВ 2008 — лучшая песня («Мой рай»), лучшая исполнительница.
13. Премия Billboard 2008 — самый продаваемый альбом («Мой рай»).
14. Fresh Art 2008 — самая стильная певица. 15. Glamour Awards 2008 — певица года.
16. Золотой Граммофон 2008 — статуэтка за песню «Научусь летать».
17. Премия Муз-ТВ 2009 — лучшая исполнительница.
